import React, { Component } from 'react'
import { Cascader } from 'antd';



export default class CitySwitcher extends React.Component {


    render() {
        const options = [
            {
                value: 'zhejiang',
                label: 'Zhejiang',
                children: [
                    {
                        value: 'hangzhou',
                        label: 'Hangzhou',
                        children: [
                            {
                                value: 'xihu',
                                label: 'West Lake',
                            },
                        ],
                    },
                ],
            },
            {
                value: 'jiangsu',
                label: 'Jiangsu',
                children: [
                    {
                        value: 'nanjing',
                        label: 'Nanjing',
                        children: [
                            {
                                value: 'zhonghuamen',
                                label: 'Zhong Hua Men',
                            },
                        ],
                    },
                ],
            },
        ];

        function onChange(value) {
            console.log(value);
        }

        // Just show the latest item.

        return (
            <Cascader
                options={options}
                expandTrigger="hover"
                onChange={onChange}
            />
        );
    }
}
